textfsm_template:
Value SLOT (\S+)
Value TRANSCEIVER (\S+\/\S+)
Value MODEL (\S+)
Value TYPE (\S+)
Value CONNECTOR (\S+)
Value ENCODING (\S+)
Value WAVELENGTH (\d+nm)
Value TRANSFERRATE (\d+Gb\/s)
Value LENGTH (\d+\w+)
Value VENDOR (\S+)
Value SERIALNUMBER (\S+)
Value IDENTIFIER (\S+)
Value DATECODE (\d{4}-\d{2}-\d{2})

Start
  ^Slot\s+${SLOT}:
  ^\s+Transceiver\s+${TRANSCEIVER}
  ^\s+Model:\s+${MODEL}
  ^\s+Type:\s+${TYPE}
  ^\s+Connector:\s+${CONNECTOR}
  ^\s+Encoding:\s+${ENCODING}
  ^\s+Wavelength:\s+${WAVELENGTH}
  ^\s+TransferRate:\s+${TRANSFERRATE}
  ^\s+Length:\s+${LENGTH}
  ^\s+Vendor:\s+${VENDOR}
  ^\s+SerialNumber:\s+${SERIALNUMBER}
  ^\s+Identifier:\s+${IDENTIFIER}
  ^\s+DateCode:\s+${DATECODE} -> Record
